package problem.brainteaser;

import javax.swing.plaf.synth.SynthSeparatorUI;

public class MorganString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String a = "";
		String b = ""; 
		//System.out.println(morganAndString(a,b));
		
		String result = "";
	
		System.out.println(result.equals(morganAndString(a, b)));
	}

	public static String morganAndString(String a, String b) {
        int lenA = 0;
        int lenB = 0;
        StringBuilder s = new StringBuilder();
        while(lenA < a.length() && lenB < b.length()){
            if(a.charAt(lenA) <= b.charAt(lenB)){
                s.append(a.charAt(lenA));
                lenA++;
            }else{
                s.append(b.charAt(lenB));
                lenB++;
            }
        }
        while(lenA < a.length()){
            s.append(a.charAt(lenA));
            lenA++;
        }
        while(lenB < b.length()){
            s.append(b.charAt(lenB));
            lenB++;
        }

        return s.toString();
    }
}
